package focus.javabase.com.leetcode;

import focus.javabase.com.baseTest.AbstractTest;
import org.junit.After;
import org.junit.Assert;
import org.junit.Before;
import org.junit.Test;

import static org.junit.Assert.*;


//
//Given two strings s and t which consist of only lowercase letters.
//
// String t is generated by random shuffling string s and then add one more lett
//er at a random position.
//
// Find the letter that was added in t.
//
// Example:
//
//Input:
//s = "abcd"
//t = "abcde"
//
//Output:
//e
//
//Explanation:
//'e' is the letter that was added.
public class FindTheDifferenceT389Test extends AbstractTest {

    @Before
    public void setUp() throws Exception {
        exceptedChar = 't';
        inputStrs = new String[]{"", ""};
    }

    //Wrong Answer: input:
    // ""
    // ""
    //
    // Output:"y" Expected:"t" stdout:
    @Test
    public void findTheDifference() {
        Assert.assertEquals(exceptedChar, FindTheDifferenceT389.findTheDifference(inputStrs[0], inputStrs[1]));
    }


}